type SignUpInfo = {
  label: string;
  type: string;
  name: string;
  placeholder: string;
  required: boolean;
  duplicationCheck : boolean;
  certification: boolean;
}

const signUpInfo: SignUpInfo[] = [
  {
    label: "아이디",
    type: 'text',
    name: 'memberId',
    placeholder: '아이디를 입력해주세요',
    required: true,
    duplicationCheck: true,
    certification: false,
  },
  {
    label: "비밀번호",
    type: 'password',
    name: 'password',
    placeholder: '비밀번호를 입력해주세요',
    required: true,
    duplicationCheck: false,
    certification: false,
  },
  {
    label: "비밀번호확인",
    type: 'password',
    name: 'passwordConfirm',
    placeholder: '비밀번호를 한번 더 입력해주세요',
    required: true,
    duplicationCheck: false,
    certification: false,
  },
  {
    label: "이름",
    type: 'text',
    name: 'name',
    placeholder: '이름을 입력해주세요',
    required: true,
    duplicationCheck: false,
    certification: false,
  },
  {
    label: "이메일",
    type: 'text',
    name: 'email',
    placeholder: '예: marketkurly@kurly.com',
    required: true,
    duplicationCheck: true,
    certification: false,
  },
  {
    label: "휴대폰",
    type: 'tel',
    name: 'mobileNumber',
    placeholder: '숫자만 입력해주세요',
    required: true,
    duplicationCheck: false,
    certification: true,
  },
  {
    label: "주소",
    type: 'button',
    name: '',
    placeholder: '',
    required: true,
    duplicationCheck: false,
    certification: false,
  },
  {
    label: "성별",
    type: '',
    name: '',
    placeholder: '',
    required: false,
    duplicationCheck: false,
    certification: false,
  },
  {
    label: "생년월일",
    type: '',
    name: '',
    placeholder: '',
    required: false,
    duplicationCheck: false,
    certification: false,
  },
]

export default signUpInfo
